import React from "react";
import NavBar from "./navbar";
import { Slide } from "react-slideshow-image";
import "react-slideshow-image/dist/styles.css";
import JTemplate from "./jtemplate";
class HomePage extends React.Component {
  render() {
    const jtemp = {
      header: "WE BUILD SOLUTION AND SELL QUALITY PRODUCT",
      content:
        "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Auctor actristique pellentesque sagittis aliquet nunc. In cursus erat odioarcu, ornare. Sed risus et.",
      btnText: "GET STARTED",
    };
    return (
      <div>
        <NavBar color="white" active="login" />
        <div className="bg-blue-00 h-screen">
          <Slide>
            <JTemplate data={jtemp} />
          </Slide>
        </div>
      </div>
    );
  }
}

export default HomePage;
